import React from 'react';

const ComplexList = (list) => {
    <ul>
        {list.map(item => (
            <li key={item.id}>
                <div>{item._id}</div>
                <div>{item._id}</div>
                <div>{item.residentFirstName}</div>
            </li>
        ))}
    </ul>
};

export default ComplexList;
